import React from 'react';

const Register = () => {
  return (
    <div className="p-8 max-w-md mx-auto text-center">
      <h1 className="text-3xl font-bold mb-4">Registracija</h1>
      <p>Forma za registraciju dolazi uskoro.</p>
    </div>
  );
};

export default Register;
